MILANO - Via F. Cilea 56, a pochi passi dalla Metro Bonola ( 500 metri ) e da tutti i servizi, in un quartiere in forte espansione, proponiamo in vendita uno splendido trilocale posto al piano rialzato, completamente ristrutturato con stile.L'appartamento è composto da : - ingresso
- soggiorno con cucina a vista e balcone;
- cameretta con balcone;
- camera matrimoniale;
- bagno; 
- ripostiglio;
- cantina.Riscaldamento autonomo.Rifacimento totale dell'impianto elettrico nonchè idraulico, riscaldamento autonomo con caldaia a condensazione ad alto rendimento termico.Gli infissi saranno nuovi e cambiati a breve (nelle foto sono presenti quelli precedenti)L'appartamento è molto comodo per una famiglia con figli, di fronte un asilo.Splendido giardino condominiale.Consigliato per chi vuole avere
